  return (
    <div className="tour__card">
      <Card>
        <div className="tour__img">
            <img scr={photo} alt="tour-img" />
            <span>Featured</span>
        </div>
      </Card>

      <CardBody>
        <div className="card__top ">

        </div>
      </CardBody>
    </div>
  );
};

